import React from 'react';

export default function Objectives() {
  const list = [
    'Centraliser et analyser les données agro-environnementales',
    'Détecter précocement les risques et anomalies',
    'Fournir des recommandations optimisées pour irrigation et fertigation',
    'Simuler et optimiser la rentabilité des exploitations',
    'Assurer assistance conversationnelle via chatbot IA',
    'Détecter automatiquement maladies et ravageurs via vision artificielle'
  ];
  return (
    <section id="objectives" className="py-12 bg-gray-50 rounded-lg mt-8 p-6">
      <h3 className="text-2xl font-semibold mb-4">Objectifs</h3>
      <ul className="list-disc list-inside space-y-2 text-gray-700">
        {list.map((l, i) => <li key={i}>{l}</li>)}
      </ul>
    </section>
  );
}
